    <h1 {...{
      "id": "colours"
    }}>{`Colours`}</h1>
    <h6 {...{
      "id": "overview"
    }}>{`Overview`}</h6>
    <h5 {...{
      "id": "remaining-consistent-across-staples-various-digital-products-whether-it-be-applications-subsites-or-other-experiences-requires-rules-around-colour-usage"
    }}>{`Remaining consistent across Staples various digital products, whether it be applications, subsites or other experiences, requires rules around colour usage.`}</h5>
    <h3 {...{
      "id": "colour-palette"
    }}>{`Colour Palette`}</h3>
    <p>{`The Staples colour palette is comprised of Primary, Secondary and Tertiary colours. Each created with a specific purpose in mind to help shape the brand weve all come to know.`}</p>
    <h4 {...{
      "id": "primary-colours"
    }}>{`Primary Colours`}</h4>
    <h4 {...{
      "id": "secondary-colours"
    }}>{`Secondary Colours`}</h4>
    <h4 {...{
      "id": "tertiary-colours"
    }}>{`Tertiary Colours`}</h4>
    <h3 {...{
      "id": "applying-colour"
    }}>{`Applying Colour`}</h3>
    <p><strong parentName="p">{`Staples Red`}</strong>{` serves as the `}<strong parentName="p">{`primary call-to-action colour`}</strong>{` across all Staples products and experiences. It is only to be used sparingly and with intent. Reserve its use to highlight critically important information. Never to be used in headings or body copy.`}</p>
    <p><strong parentName="p">{`White`}</strong>{` is to be used as the `}<strong parentName="p">{`default background`}</strong>{`. Its also useful for meeting contrast requirements when there is a need to overlay text on top of solid colour elements.`}</p>
    <p><strong parentName="p">{`Charcoal`}</strong>{` is best suited for `}<strong parentName="p">{`headings`}</strong>{` and `}<strong parentName="p">{`body copy`}</strong>{`. It can be used as a background with white text on occasion.`}</p>
    <p><strong parentName="p">{`Mid-Gray`}</strong>{` is intended for `}<strong parentName="p">{`pull quotes, sub-headings, lead text, list bullets, form input text, icons, tertiary links and buttons`}</strong>{`, to name a few.`}</p>
    <p><strong parentName="p">{`Light-Gray`}</strong>{` is best used as the main colour for `}<strong parentName="p">{`element outlines, dividers, disabled text, buttons or states`}</strong>{`.`}</p>
    <p><strong parentName="p">{`Lightest-Gray`}</strong>{` is best used as a `}<strong parentName="p">{`background`}</strong>{` to highlight important information or where a user is able to interact with elements. It should `}<strong parentName="p">{`never be used for text`}</strong>{`.`}</p>
    <p><strong parentName="p">{`Chartreuse`}</strong>{` is intended to be used sparingly to `}<strong parentName="p">{`accent deals or promotions`}</strong>{`.`}</p>
    <p><strong parentName="p">{`Cork`}</strong>{` is used to `}<strong parentName="p">{`accent long running promotions`}</strong>{` and as a solid colour background.`}</p>
    <p><strong parentName="p">{`Blue`}</strong>{` is to be used to `}<strong parentName="p">{`accent new or featured products`}</strong>{` and as a solid colour background.`}</p>
    <p><strong parentName="p">{`Dark Blue`}</strong>{` is predominantly used for `}<strong parentName="p">{`text links`}</strong>{` and `}<strong parentName="p">{`secondary buttons`}</strong>{`.`}</p>
    <p><strong parentName="p">{`Lightest-Blue`}</strong>{` is ideal for `}<strong parentName="p">{`hover states`}</strong>{` within table elements, dropdowns, menus and lists.`}</p>
    <hr></hr>
    <h6 {...{
      "id": "usage"
    }}>{`Usage`}</h6>
    <h5 {...{
      "id": "colour-in-the-staples-design-system-is-managed-using-colour-tokens-this-allows-us-to-remain-consistent-across-all-our-digital-interfaces-and-applications"
    }}>{`Colour in the Staples Design System is managed using colour tokens. This allows us to remain consistent across all our digital interfaces and applications.`}</h5>
    <h3 {...{
      "id": "colour-tokens"
    }}>{`Colour Tokens`}</h3>
    <p>{`Colour in the Staples Design System is managed using colour tokens. Tokens are a method of noting colour by role or usage, independent of the actual colour value (hex). For instance, instead of having to code all instances of a primary button in a UI to be `}<inlineCode parentName="p">{`#CC0000`}</inlineCode>{`, the primary button component specifies the token `}<inlineCode parentName="p">{`$brand-red`}</inlineCode>{` for these buttons, and that token is specified in a separate file to be `}<inlineCode parentName="p">{`#CC0000`}</inlineCode>{`.`}</p>
    <p>{`A single token can be associated to multiple roles, but only if the colour value is used consistently across those roles. This allows for uniform colour application and efficient global changes while maintaining full styling flexibility.`}</p>
